TypeScript support default generic since version 2.3, So I add generic to collection. When create a collection by `DB.collection()`or`DB.createCollection()`, developer could specify a scheme, and when do some query, the result can be static analysd.

These changes don't break the old cold.

eg:
```typescript
import { MongoClient } from 'mongodb'

interface User {
  name: string
  gender: number
}

interface SomeType {
  // ...
}


MongoClient.connect('...').then(DB => {
  // It's also support old code
  DB
    .collection('User')
    .find()
    .toArray()
    .then(arr => {
      arr.forEach(user => {
        // user: any
      })
    })

  DB
    .collection<User>('User')
    .find()
    .toArray()
    .then(arr => {
      arr.forEach(user => {
        console.log(user.gender) // user: User
      })
    })

  DB
    .collection<User>('User')
    .aggregate<SomeType>([])
    .toArray()
    .then(arr => {
      arr.forEach(item => {
        // item: SomeType
      })
    })

  DB
    .collection<User>('User')
    .findOne({})
    .then(user => {
      // user: User
    })

  DB
    .collection<User>('User')
    .findOne<SomeType>({}, { fields: {/* ... */ } }) // If pass fields option, could specify generic to `findOne()`
    .then(user => {
      // user: SomeType
    })
})
```

Proposed change for @pawsong

I'm using ndarray to handle a multi-dimensional array of objects but this typing is not allowing me to. It requires the array to be `number[]`.

After this change ndarray can still be used without generic notation, it will just be inferred from the passed argument:

```typescript
const sut1 = ndarray(new Int8Array([1,2,3]);
const value1 = sut.get(0);
// value1 has inferred type: number

const sut2 = ndarray([ 'testing', 'foo' ]);
const value2 = sut2.get(0);
// value2 has inferred type: string
```
